import {React} from'react'

const TodoList =({todolist}) => {

  return (

  	<div>

  	{todolist.map((todo,index) =>

  		<div key={index}>
  		<h5>{todo} &nbsp; <button>Delect</button></h5>
  		</div>)}
  		</div>


  	)  	

}
export default todolist
